import React from "react";
import { BrowserRouter as Link } from "react-router-dom";

const NavLinkItem = (props) => {
  return (
    <Link
      to={props.direction}
      className="text-base font-medium text-gray-500 hover:text-gray-900"
    >
      {this.props.name}
    </Link>
  );
};

export default NavLinkItem;
